import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './App.css';

function App () {
  const [categories, setCategories] = useState({ data: [] });

  useEffect(async () => {
    const result = axios.get('https://opentdb.com/api_category.php')
      .then(res => setCategories(res.data))
  }, [])
  return (
    <div>
      {categories.map(category => {
        return (
          <div key={category.id}>
            <p>{category.name}</p>
          </div>
        )
      })}
    </div>
  );
}

export default App;
